INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "お！\nあそこに困ってそうな人発見！", 0, 0, 1, 1, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 0, 0, 2, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "大切な人を\n守れるようになりたい…って", 0, 0, 1, 1, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 1.4, 0, 0, 2, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "キミに必要な集中力と感性が", 0, 0, 1, 1, "士条 怜", "フェンシングを始めてみては？", 1.4, 0, 0, 2, 1003, "少しは磨かれると思いますよ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "今日はなにして遊ぶ？", 0, 0, 1, 1, "穂高 みそぎ", "ねぇ、にいちゃん！", 1.5, 0, 0, 2, 1004, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "ねぇ…", 0, 0, 1, 1, "風宮 あかり", "風宮あかりです", 1.4, 0, 0, 2, 1006, "私といっしょに…\nいかない？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "プリンたべたいのー", 0, 0, 1, 1, "出雲 宮子", "出雲宮子なのー", 1.5, 0, 0, 2, 1007, "食べ物の恨みは怖いのー");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, 1, 1, "虹村 雪", "ボクは虹村雪。", 1.4, 0, 0, 2, 1008, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, 1, 1, "柊杏奈", "フッ…聞いて後悔するがいい！", 1.4, 0, 0, 2, 1009, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, 1, 1, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 0, 0, 2, 1010, "ほんまおおきにやわ～♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, 1, 1, "衣之咲 璃乃", "衣之咲璃乃です！", 1.4, 0, 0, 2, 1011, "ここで会ったが\n100年目～！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "ち、超能力って…\n何のことかな～？", 0, 0, 1, 1, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 0, 0, 2, 1012, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "一応カリスマ読モJKやってまっす！", 0, 0, 1, 1, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 1.4, 0, 0, 2, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "東京は遊園地みたいなところさー", 0, 0, 1, 1, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 1.4, 0, 0, 2, 1017, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "先生って呼ばれるのは\nくすぐったいから", 0, 0, 1, 1, "支倉 伊緒", "支倉伊緒です。", 1.4, 0, 0, 2, 1018, "イオちゃんって呼んでね。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, 1, 1, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 0, 0, 2, 1020, "ミミをおいてかないでぇ～");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "あの……\nふぇ……", 0, 0, 1, 1, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 0, 0, 2, 1021, "ふぇぇぇぇぇん……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "こんな私に貴重な時間を\n割いていただき、", 0, 0, 1, 1, "風宮 より", "風宮よりです。\nあああああ！", 1.4, 0, 0, 2, 1022, "なんてありがとうございます！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "おにいちゃんどこいくの？\nえ？", 0, 0, 1, 1, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 0, 0, 2, 1023, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, 1, 1, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 1.4, 0, 0, 2, 1025, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "あなたは…運命の……\n伴侶……", 0, 0, 1, 1, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 1.4, 0, 0, 2, 1027, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, 1, 1, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 0, 0, 2, 1028, "…そうでしょ？？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 0, 1, 1, "桜井 望", "桜井望だよ！\nよろしくねっ", 1.4, 0, 0, 2, 1029, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, 1, 1, "ニノン・ジュベール", "デケデケデンっ！", 1.4, 0, 0, 2, 1030, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 0, 1, 1, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 1.4, 0, 0, 2, 1031, "おかしいですね……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "けんども\nそれには足りないモンが…", 0, 0, 1, 1, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 0, 0, 2, 1033, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "ちょっと緊張しちゃって…", 0, 0, 1, 1, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 0, 0, 2, 1034, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "知らない人とは話しちゃいけないので", 0, 0, 1, 1, "氷川 鏡華", "氷川鏡華…です", 1.5, 0, 0, 2, 1036, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "……あ、アラーム。", 0, 0, 1, 1, "柏崎 栞", "柏崎…栞です。", 1.4, 0, 0, 2, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "私、一人も友達がいなくて……", 0, 0, 1, 1, "双葉 碧", "ふ、双葉碧です。", 1.4, 0, 0, 2, 1040, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 0, 1, 1, "三角 千歌", "三角千歌です。", 1.4, 0, 0, 2, 1042, "そう思っています。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "あぁ？\nお前のそいつの仲間か？", 0, 0, 1, 1, "安芸 真琴", "安芸真琴だ。", 1.4, 0, 0, 2, 1043, "う、疑ってすまなかったな…");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "生けとし生ける全ての者よ！", 0, 0, 1, 1, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 1.4, 0, 0, 2, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "ぐふふふふ……はっ！", 0, 0, 1, 1, "遠見 空花", "そこで騎士は妖精を乱暴に……", 1.4, 0, 0, 2, 1045, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 0, 1, 1, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 0, 0, 2, 1046, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "それでは早速クエストに…", 0, 0, 1, 1, "大神 美冬", "大神美冬よ！", 1.4, 0, 0, 2, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "クエストもバトルも\n掃除も洗濯も", 0, 0, 1, 1, "星野静流", "星野静流だよ！", 1.4, 0, 0, 2, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "見ての通りの\nセクシー美少女で", 0, 0, 1, 1, "玉泉美咲", "アタシは玉泉美咲。", 1.5, 0, 0, 2, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "？？？？", 0, 0, 1, 1, "リマ", "？？？", 1.4, 0, 0, 2, 1052, "？？？？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, 1, "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1053, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, 1, "ペコリーヌ", "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1058, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, 1, "コッコロ", "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1059, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, 1, "キャル", "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1060, "そ、そこまでいうなら\nもらってやる");
